"original": |2-
     This response indicates that the request has been received by the
     next-hop server and that some unspecified action is being taken on
     behalf of this call (for example, a database is being consulted).
     This response, like all other provisional responses, stops
     retransmissions of an INVITE by a UAC.  The 100 (Trying) response is
     different from other provisional responses, in that it is never
     forwarded upstream by a stateful proxy.
"fixed": |-
  This response indicates that the request has been received by the next-hop server and that some unspecified action is being taken on behalf of this call (for example, a database is being consulted). This response, like all other provisional responses, stops retransmissions of an INVITE by a UAC.  The 100 (Trying) response is different from other provisional responses, in that it is never forwarded upstream by a stateful proxy.
"ko": |-
  이 응답은 다음 홉 서버가 요청을 수신했으며 이 호출을 대신하여 지정되지 않은 일부 작업이 수행되고 있음을 나타냅니다(예: 데이터베이스를 참조하는 중). 다른 모든 임시 응답과 마찬가지로 이 응답은 UAC에 의한 INVITE 재전송을 중지합니다. 100(시도 중) 응답은 상태 저장 프록시에 의해 업스트림으로 전달되지 않는다는 점에서 다른 임시 응답과 다릅니다.
